import React from 'react';

import './Login.css';
import { IonPage, IonContent, IonImg, IonInput, IonCheckbox, IonButton, IonItem, IonHeader, IonLabel } from '@ionic/react';

//#region Images

// import ump from '/login/logo-black-title.png';
// import vk from '/login/vk.png';
// import fb from '/login/f.png';

//#endregion

function Login() {
    return(
        <IonPage class='_login'>
            <IonContent>
                <IonImg src='/login/logo-black-title.png' alt='logo' class='_login-logo'></IonImg>
                <IonInput type='email'></IonInput>
                <IonInput type='password'></IonInput>
                <IonCheckbox>Запомнить меня</IonCheckbox>
                <IonButton type='submit'>Войти</IonButton>
                <IonItem>
                    <IonImg alt='vk' class='_login-social-network'></IonImg>
                    <a href='#/vk'>Войти через ВК</a>
                </IonItem>
                <IonItem>
                    <IonImg alt='fb' class='_login-social-network'></IonImg>
                    <a href='#/fb'>Войти через FB</a>
                </IonItem>
            </IonContent>
        </IonPage>
    );
}

export default Login;
